CREATE TABLE `programme_plan_project_plan` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `year` int(11) NOT NULL COMMENT '年份',
  `region_code` varchar(50) NOT NULL COMMENT '区划代码',
  `region_name` varchar(50) NOT NULL COMMENT '乡镇街道',
  `farmers_total` int(11) NOT NULL COMMENT '户籍农户总数（户）',
  `farmers_new_access` int(11) NOT NULL COMMENT '新增接户数（户）',
  `farmers_annual_access` int(11) NOT NULL COMMENT '202X年底接户数（户）',
  `facility_total` int(11) NOT NULL COMMENT '原有设施总数（户）',
  `facility_new_factory` int(11) NOT NULL COMMENT '新增纳厂数',
  `facility_new_concerntrated` int(11) DEFAULT NULL,
  `facility_new_inhouse` int(11) NOT NULL COMMENT '新增户用处理设施数',
  `facility_remould_promote` int(11) NOT NULL COMMENT '改造提升设施数',
  `facility_remould_facotry` int(11) NOT NULL COMMENT '改造纳厂设施数',
  `facility_scrap` int(11) NOT NULL COMMENT '废弃设施数',
  `facility_new_total` int(11) NOT NULL COMMENT '新建改造拆除后处理设施总数',
  `facility_pilot` int(11) NOT NULL COMMENT '绿色处理设施试点数',
  `village_pilot` int(11) NOT NULL COMMENT '污水零直排村试点数',
  `estimated_amount` decimal(18,6) NOT NULL COMMENT '估算投资金额（万元）',
  `type` int(11) NOT NULL COMMENT '计划类型（1-规划计划；2-实施计划）',
  `work_flow_age` int(11) DEFAULT NULL,
  `work_flow_current_assignee` json DEFAULT NULL,
  `work_flow_state` varchar(64) DEFAULT NULL,
  `work_flow_creator` varchar(64) DEFAULT NULL,
  `work_flow_update_time` datetime DEFAULT NULL,
  `process_region_code` varchar(64) DEFAULT NULL,
  `process_id` varchar(64) DEFAULT NULL,
  `process_desc` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=114 DEFAULT CHARSET=utf8;
